import React, { Suspense, lazy } from 'react';
import './styles/App.css';

// Lazy load các component
const Header = lazy(() => import('./components/Header/Header'));
const PlayPage = lazy(() => import('./components/PlayPage/PlayPage'));
const ErrorModal = lazy(() => import('./components/ErrorModal/ErrorModal'));
const Toolbar = lazy(() => import('./components/Toolbar/Toolbar'));

// Component Loading chung
const Loading = ({ component }) => <div>Loading {component}...</div>;

const Game = () => {
  return (
    <div className="wrapper">
      <Suspense fallback={<Loading component="app" />}>
        <Header />
        <PlayPage />
        <ErrorModal />
        <Toolbar />
      </Suspense>
    </div>
  );
}

export default Game;
